import { colors, fonts } from "@/theme";
import React from "react";
import { StyleSheet, Text, TouchableOpacity, View } from "react-native";

const UnitItem = ({ item }: any) => {
  const getStatusStyles = () => {
    switch (item.status) {
      case "Pending":
        return {
          backgroundColor: colors.pending,
          textColor: colors.pendingText,
        };
      case "Allocation":
        return { backgroundColor: colors.allocted, textColor: colors.primary };
      case "Conditional":
        return {
          backgroundColor: colors.conditional,
          textColor: colors.conditionalText,
        };
      default:
        return { backgroundColor: "transparent", textColor: colors.gray };
    }
  };

  const { backgroundColor, textColor } = getStatusStyles();

  return (
    <TouchableOpacity>
      <View style={styles.unitContainer}>
        <View>
          <View style={styles.unitInfo}>
            <Text style={styles.price}>{item.price}</Text>
            <Text style={styles.suite}>{item.suite}</Text>
          </View>
          <View style={styles.detailsRow}>
            <Text style={styles.details}>{item.details1}</Text>
            <View style={styles.dot} />
            <Text style={styles.details}>{item.details2}</Text>
            <View style={styles.dot} />
            <Text style={styles.details}>{item.details3}</Text>
          </View>
          <View style={styles.detailsRow}>
            <Text style={styles.details}>{item.details5}</Text>
            <View style={styles.dot} />
            <Text style={styles.details}>{item.details4}</Text>
          </View>
        </View>
        <View>
          <View style={[styles.statusButton, { backgroundColor }]}>
            <Text style={[styles.statusText, { color: textColor }]}>
              {item.status}
            </Text>
          </View>
          {item.status === "Allocation" ? (
            <TouchableOpacity style={styles.worksheetButton}>
              <Text style={styles.worksheetButtonText}>+ Worksheet</Text>
            </TouchableOpacity>
          ) : (
            <Text style={styles.codes}>{item.codes}</Text>
          )}
        </View>
      </View>
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  section: {
    padding: 16,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: "700",
    lineHeight: 24,
    color: colors.primary,
    fontFamily: fonts.calibri.bold,
  },
  desc: {
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
  },
  notification: {
    padding: 6,
    height: 40,
    width: 40,
    alignItems: "center",
    borderRadius: 100,
    borderColor: colors.disablebutton,
    borderWidth: 1,
    marginRight: 8,
    backgroundColor: colors.white,
  },
  unitContainer: {
    backgroundColor: colors.white,
    flexDirection: "row",
    justifyContent: "space-between",
    padding: 16,
    borderBottomColor: colors.disablebutton,
    borderBottomWidth: 1,
  },
  unitInfo: {
    flexDirection: "row",
    alignItems: "center",
    marginVertical: 4,
  },
  price: {
    fontSize: 16,
    fontWeight: "700",
    lineHeight: 24,
    fontFamily: fonts.calibri.bold,
    color: colors.black,
  },
  suite: {
    fontSize: 16,
    fontWeight: "400",
    lineHeight: 24,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
    marginLeft: 6,
  },
  detailsRow: {
    flexDirection: "row",
    alignItems: "center",
    width: 150,
    marginVertical: 4,
  },
  details: {
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
  },
  dot: {
    height: 2,
    width: 2,
    borderRadius: 50,
    padding: 3,
    backgroundColor: colors.gray,
    marginHorizontal: 5,
  },
  statusButton: {
    paddingVertical: 4,
    height: 30,
    paddingHorizontal: 7,
    borderRadius: 100,
    alignItems: "center",
  },
  statusText: {
    fontSize: 14,
    fontWeight: "700",
    lineHeight: 24,
    fontFamily: fonts.calibri.bold,
  },
  codes: {
    marginTop: 8,
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    fontFamily: fonts.calibri.bold,
    color: colors.primary,
    textDecorationLine: "underline",
  },
  worksheetButton: {
    marginTop: 8,
    paddingVertical: 8,
    paddingHorizontal: 12,
    borderRadius: 4,
    backgroundColor: colors.white,
    borderWidth: 1,
    borderColor: colors.disablebutton,
    alignItems: "center",
  },
  worksheetButtonText: {
    fontSize: 14,
    fontWeight: "700",
    lineHeight: 20,
    color: colors.primaryBlue,
    fontFamily: fonts.calibri.bold,
  },
  statusButtonText: {
    fontSize: 16,
    fontWeight: "400",
    lineHeight: 24,
    color: colors.black,
    fontFamily: fonts.calibri.regular,
    textAlign: "center",
  },
});

export default UnitItem;
